import React from 'react'

export const Categories = (props) => {
    const constructor = props => {
        state = {
            categories: [
                {
                    key: 'all',
                    name: 'Всё'
                },
                {
                    key: 'motorbike',
                    name: 'Мотоциклы'
                },
                {
                    key: 'moped',
                    name: 'Мопеды'
                },
                {
                    key: 'scooter',
                    name: 'Скутеры',
                }
            ]
        }
    }

    return (
        <div>Categories</div>
    )
}

export default Categories
